Hear what Jesus, having the sharp double-edged sword, says to the church in Pergamos. As we continue our study through Revelation 2; we read the commendations and corrections for the city where Satan was dwelling. Learn from the Bible the imminent danger in mixing with the world - the doctrine of Balaam. Here we are called to repent from sin. By the grace of the Lord, enormous blessing is for those who have an ear to hear what the Spirit is saying to these seven churches.

Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.  
